css:
pre.similar-code-detector-block {
  background: #2E3239;
  color: #eff1f5;
  overflow-x: auto;
  padding: 8px 0;
}
pre.similar-code-detector-block code {
  white-space: pre;
}
.similar-code-detector-line {
  color: #65737e;
  opacity: 0.6;
  padding: 0 1em;
}
.similar-code-detector-context {
  opacity: 0.8;
  /* Override default italic style */
}
.similar-code-detector-context.syntax--comment {
  font-style: normal;
}
.similar-code-detector-gap {
  margin: 0.5em 0;
  background: repeating-linear-gradient(-45deg, #353941, #353941, 5px, transparent 5px, transparent 10px);
}
